window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"28.1.0","implementation":{"version":"12.2.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"darwin","version":"23.6.0"},"runtime":{"name":"node.js","version":"22.20.0"}}},{"source":{"data":"@Signup\nFeature: User Signup Functionality\n  As a new Mikloset user\n  I want to sign up using Google or Email\n  So that I can create an account and access my personalized dashboard\n\n  Background:\n    Given I am on the Mikloset signup page\n    And I click on Sign up with email\n\n  # -------------------------------\n  # UI Verification\n  # -------------------------------\n  @UI\n  # Scenario: Verify signup page elements are displayed correctly\n  #   Then I should see \"Continue with Google\" option\n  #   And I should see \"Sign up with email\" option \n  #   And I click on Sign up with email\n  #   And I should see fields for \"Full name\", \"Email address\", \"Username\" and \"Password\"\n  #   And I should see gender options \"Female\", \"Male\", and \"Gender Neutral\"\n  #   And I should see a Sign up button\n\n  # -------------------------------\n  # Google Signup (not automated)\n  # -------------------------------\n#   @GoogleSignup\n#   Scenario: Sign up using Google account (manual verification only)\n#     When I click on \"Continue with Google\"\n#     Then I should be redirected to the Google authentication page\n#     # Manual: Verify successful login redirects to dashboard\n\n  # -------------------------------\n  # Positive Scenario\n  # -------------------------------\n  @Positive\n  Scenario Outline: Successful signup using valid email details\n      When I enter full name \"\x3Cfullname>\"\n    And I enter email address \"\x3Cemail>\"\n    And I enter username \"\x3Cusername>\"\n    And I enter password \"\x3Cpassword>\"\n    And I select gender \"\x3Cgender>\"\n    And I click on Sign up button\n    Then I should see a success message Signup successful\n    And I should be redirected to the Mikloset dashboard\n\n    Examples:\n      | fullname     | email                  | username   | password  | gender         |\n      | Imran Khan   | imranatddtysd@example.com      | imafjhgsran123   | Test@123  | Male           |\n      | Sara Mathew  | sasdagfutra@example.com       | sawesrra001    | Test@456  | Female         |\n      | Alex Taylor  | aleffydx@example.com       | aleqjfgwecx789    | Test@789  | Gender Neutral |\n\n  # -------------------------------\n  # Negative Scenarios\n  # -------------------------------\n  @Negative\n  Scenario: Signup attempt with all fields blank\n      When I leave all fields blank\n    And I click on Sign up button\n    Then the Sign up button should be disabled\n    And I should see validation messages for required fields\n\n  @Negative\n  Scenario: Signup attempt with invalid email format\n    When I enter email address \"invalid-email\"\n     And I click on Sign up button\n    Then I should see an error message \"Please enter valid email\"\n\n  @Negative\n  Scenario: Signup attempt with weak password\n    When I enter password \"12345\"\n    Then I should see an error message \"Password must be minimum 6 characters, including at least letter, 1 numeric and 1 special character\"\n\n  @Negative\n  Scenario: Signup attempt with already registered email\n    When I enter email address \"imran023786@gmail.com\"\n    And I enter password \"Test@123\"\n    And I select gender \"Male\"\n    When I enter username \"imran467267\"\n    And I enter full name \"Imran Khan\"\n     And I click on Sign up button\n    Then I should see an error message \"User already exits with provided email\"\n\n  @Negative\n  Scenario: Signup attempt with already taken username\n    When I enter username \"imran46726\"\n    And I enter full name \"Imran Khan\"\n    And I enter email address \"imran@yopexample.com  \"\n    And I enter password \"Test@123\"\n    And I select gender \"Male\"\n    And I click on Sign up button\n    Then I should see an error message \"Username already exists\"\n\n  # -------------------------------\n  # Edge Cases\n  # -------------------------------\n  @Edge\n  Scenario: Signup with leading/trailing spaces in input fields\n    When I enter full name \"  Imran Khan  \"\n    And I enter email address \"  imrantyiqwe@example.com  \"\n    And I enter username \"  imryuiank  \"\n    And I enter password \"  Test@123  \"\n    And I select gender \"Male\"\n    And I click on Sign up button\n    Then I should see a success message Signup successful\n\n  @Edge\n  Scenario: Signup with case-sensitive email and username\n    When I enter full name \"  Imran Khan  \"\n    And I enter email address \"IMtytRAN@mILEXAMPLE.COM\"\n    And I enter username \"ImRchan\"\n    And I enter password \"  Test@123  \"\n    And I select gender \"Male\"\n    And I click on Sign up button\n    Then I should see a success message Signup successful\n   \n\n  @Edge\n  Scenario: Signup with special characters in username\n    When I enter username \"imran@123\"\n    Then I should see an error message \"Sorry, only letters (a-z), numbers (0-9), and periods (.) are allowed.\"\n\n  @Edge\n  Scenario: Signup without selecting gender\n    Whenn I enter full name \"  Imran Khan  \"\n    And I enter email address \"IMRAN1456w@EXAMPLE.COM\"\n    And I enter username \"ImRan\"\n    And I enter password \"  Test@123  \"\n     And I click on Sign up button\n    Then I should see an error message \"Please select\"\n","uri":"features/Signup.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@Signup","id":"4aa34482-6428-46e1-ae65-28a4f68d11e6"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"User Signup Functionality","description":"  As a new Mikloset user\n  I want to sign up using Google or Email\n  So that I can create an account and access my personalized dashboard","children":[{"background":{"id":"bc  Menu         |\n      | Home          |\n      | Add your style |\n      | Style me       |\n      | Curate me      |\n      | Follow me      |\n    And the dashboard should display a welcome message as \"Welcome, qa\"\n    And the user email should be \"shashidhar_qa@development.mikloset.com\"\n@loggedIn\n  Scenario: Navigate to \"Help me Style an Outfit\" page\n    When the user clicks the \"Help me Style an Outfit\" button\n    Then the system should navigate to the styling page successfully\n@loggedIn\n  Scenario: Validate \"Add Item(s) to My Closet\" dropdown options\n    When the user opens the \"Add Item(s) to My Closet\" dropdown\n    Then the dropdown should contain the following options:\n      | Option Name                                    | Status   |\n      | Forward Digital Receipt To shashidhar_qa@development.mikloset.com | Enabled |\n      | Add Items from Digital Receipts                | Enabled |\n      | Scan my Gmail for New Receipts                 | Disabled |\n      | Upload Item Image/URL                          | Enabled |\n    And each enabled option should be clickable\n@loggedIn\n  Scenario: Verify \"View All\" navigation and item storage\n    When the user clicks the \"View All\" button\n    Then they should be navigated to the \"My Items\" page\n    And if items are present, the item details should be stored for later use\n@loggedIn\n  Scenario: Verify category navigation and edit functionality\n    When the user opens each category from the dashboard\n    Then the page should navigate correctly for each category\n    And when the user hovers over a category\n    Then an \"Edit\" button should appear\n    When the user clicks the \"Edit\" button\n    Then they should be able to change the category picture successfully\n@loggedIn\n  Scenario: Verify user guide video playback\n    When the user plays the \"User Guide\" video\n    Then the video should start playing without error\n","uri":"features/dashboard.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Dashboard functionality","description":"  As a Mikloset user\n  I want to verify the dashboard elements and interactions\n  So that I can ensure all menus, navigation, and user actions work correctly","children":[{"background":{"id":"6475ad61-eaa9-4f67-b64a-d221d61d7367","location":{"line":7,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"0ea08a29-9d0a-4639-b667-3dbdc6e495a3","location":{"line":9,"column":5},"keyword":"Given ","keywordType":"Context","text":"the user is logged in and on the dashboard page using stored cookies"}]}},{"scenario":{"id":"3d61e6d1-29f7-46c2-b51c-975f46a9f4fe","tags":[{"location":{"line":10,"column":1},"name":"@loggedIn","id":"137a4995-f947-40cd-abdc-8bb86130597d"}],"location":{"line":11,"column":3},"keyword":"Scenario","name":"Verify dashboard menus and welcome message","description":"","steps":[{"id":"ac20ecad-050a-419e-9480-68952a212ab6","location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the dashboard should display the following menu options:","dataTable":{"location":{"line":13,"column":7},"rows":[{"id":"89e7bffd-3dde-4503-9b66-ede9b76a063f","location":{"line":13,"column":7},"cells":[{"location":{"line":13,"column":9},"value":"Menu"}]},{"id":"cef34fd6-59b8-48bc-8c8c-dd737c3a94b5","location":{"line":14,"column":7},"cells":[{"location":{"line":14,"column":9},"value":"Home"}]},{"id":"e20f5764-e4c7-4883-afb1-1041c1973caa","location":{"line":15,"column":7},"cells":[{"location":{"line":15,"column":9},"value":"Add your style"}]},{"id":"53b70d86-2712-440a-875f-07d236a94fc8","location":{"line":16,"column":7},"cells":[{"location":{"line":16,"column":9},"value":"Style me"}]},{"id":"deeea5bc-4d58-4eaf-b2c5-5a2bdc6a527f","location":{"line":17,"column":7},"cells":[{"location":{"line":17,"column":9},"value":"Curate me"}]},{"id":"da8bd6ff-8873-4
